import React from "react";
import products from "../../data/products";

export default (props) => {
  const productsList = products.map((product) => {
    return (
      <div>
        <table border="1">
          <thead>
            <tr>
              <th>Id</th>
              <th>Product</th>
              <th>Price</th>
            </tr>
          </thead>
          <tbody></tbody>
        </table>
      </div>
    );
  });
};
